  const idTextChangeHandler = (event) => {
    setIdText(event.target.value);
    console.log(idText);
  };
  const pwTextChangeHandler = (event) => {
    setPwText(event.target.value);
    console.log(pwText);
  };
  return (
    <form>
      <div>
        <label>ID</label>
        <input type="text" onChange={idTextChangeHandler} />
      </div>
      <div>
        <label>PASSWORD</label>
        <input type="password" onChange={pwTextChangeHandler} />
      </div>
      <button onSubmit={localSiginHandler}>SIGNIN</button>
    </form>
  );
};

